sys_variable_value.value:
(function execute(inputs, outputs) {
    var fullName = inputs.full_name;
    var last4 = inputs.last_4_ssn;

    // Query the onboarding contact table
    var gr = new GlideRecord('x_snc_ai_agents_0_sma_onboarding_contact');
    gr.addQuery('name', fullName);
    gr.query();

    while (gr.next()) {
        var fullSSN = gr.getValue('ssn'); // or replace with actual SSN field name
        if (fullSSN && fullSSN.slice(-4) === last4) {
            // Match found on last 4 of SSN
            outputs.name = gr.getValue('name');
            outputs.address = gr.getValue('address');
            outputs.city = gr.getValue('city');
            outputs.state = gr.getValue('state');
            outputs.email = gr.getValue('email');
            outputs.primaryaccountreference = gr.getUniqueValue(); // sys_id
            return;
        }
    }

    // If no match was found
    outputs.name = '';
    outputs.address = '';
    outputs.city = '';
    outputs.state = '';
    outputs.email = '';
    outputs.record = '';
})(inputs, outputs);

